import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.min.css";

import HandoffCreate from "./components/handoff-create.component";
import HandoffEdit from "./components/handoff-edit.component";
import HandoffList from "./components/handoff-list.component";

import logo from "./images/cleation.png";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="container">
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <a className="navbar-brand" href="https://cleation.com" target="_blank">
              <img src={logo} width="30" height="30" alt="Cleation.com" />
            </a>
            <Link to="/" className="navbar-brand">Handoffs</Link>
            <div className="collpase navbar-collapse">
              <ul className="navbar-nav mr-auto">
                <li className="navbar-item">
                  <Link to="/" className="nav-link">List Handoffs</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/create" className="nav-link">Create Handoff</Link>
                </li>
              </ul>
            </div>
          </nav>
          <br/>
          <Route path="/" exact component={HandoffList} />
          <Route path="/edit/:id" component={HandoffEdit} />
          <Route path="/create" component={HandoffCreate} />
        </div>
      </Router>
    );
  }
}

export default App;
